import React, { useState } from 'react';
import Card from '../common/Card';
import './Teamswiper.css'

function Teamswiper() {
    return (
        <div id='team-swipe'>
            <div className="container">
                <div className="row">
                    <div className="col-md-12">
                        <h5></h5>
                    </div>
                    </div>
            </div>
            <Card />
        </div>
    )
}

export default Teamswiper;
